  "paths": {
    "/v2/apis": {
      "post": {
        "operationId": "CreateApi",
        "description": "Creates an Api resource.",
        "responses": {
          "201": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/CreateApiResponse" }
              }
